void solve_2() {
    unsigned long long MOD = 9'099'099'909'999'099'999ULL;
    vector<unsigned long long> dp(10002);
    dp[0] = dp[1] = 1;
    for(int i = 2; i < 10000; ++i) dp[i] = (dp[i - 1] % MOD + dp[i - 2] % MOD) % MOD;
    for(int i = 0; i < 10000; ++i) cout << dp[i] << ", ";
    cout << "0.\n";
}

void solve_3() {
    vector<vector<char>> m(1025, vector<char>(1025, '.'));
    function<void(int, int, int)> f = [&](int x, int y, int n) {
        if(n == 4) {
            m[y][x] = m[y][x + 1] = m[y][x + 2] = m[y][x + 3] = '#';
            m[y + 1][x] = m[y + 1][x + 2] = '#';
            m[y + 2][x] = m[y + 2][x + 1] = '#';
            m[y + 3][x] = '#';
            return;
        }

        f(x, y, n / 2);
        f(x + n / 2, y, n / 2);
        f(x, y + n / 2, n / 2);
    };

    f(1, 1, 1024);

    for(int y = 1; y <= 1024; ++y) {
        for(int x = 1; x <= 1024; ++x) {
            cout << m[y][x];
        }
        cout << '\n';
    }
}

